(14, 3, '{\"es\":\"Poke bowl\",\"en\":\"Poke bowl\"}', '{\"es\":\"Esta receta de salm\\u00f3n con verduras es perfecta para llevar al trabajo, ya que no necesita calentarse, adem\\u00e1s de que es deliciosa y saludable. Este poke bowl es muy f\\u00e1cil de preparar y su sencillo paso a paso te llevar\\u00e1 de la mano para probar esta ensalada muy de moda.\",\"en\":\"This recipe for salmon with vegetables is perfect to take to work, since it does not need to be heated, besides it is delicious and healthy. This poke bowl is very easy to prepare and its simple step by step will take you by the hand to taste this very fashionable salad.\"}', '[]', 125, 5, '{\"days\":[\"monday\",\"tuesday\",\"wednesday\",\"thursday\",\"friday\",\"saturday\",\"sunday\"],\"start_date\":\"\",\"end_date\":\"\"}', 'image', 'hotrestaurant_menu_product_avatar_wmOpfI6Mw9W7QytA.jpeg', NULL, '[\"13\"]', NULL, NULL, 1),
