(43, 2, '{\"es\":\"Rollitos de pepino rellenos\",\"en\":\"Cucumber rolls stuffed\"}', '{\"es\":\"Si antes no cenabas, ahora amar\\u00e1s ir a dormir sin pesadez, despu\\u00e9s de probar estos deliciosos y ligeros Rollitos de Pepino Rellenos de Ensalada de At\\u00fan perfectos para tu dieta keto. Estos Rollitos de Pepino Rellenos de Ensalada de At\\u00fan contienen por porci\\u00f3n \\u00fanicamente 165.2 calor\\u00edas.\",\"en\":\"Now you will love going to sleep without feeling heavy, after trying these delicious and light Cucumber Rolls Stuffed with Tuna Salad.Remember that to complement a keto menu you must watch the amount of calories but without forgetting to include several food groups during the day. These Cucumber Rolls Stuffed with Tuna Salad contain only 165.2 calories per serving.\"}', '[]', 180, NULL, '{\"days\":[\"monday\",\"tuesday\",\"wednesday\",\"thursday\",\"friday\",\"saturday\",\"sunday\"],\"start_date\":\"\",\"end_date\":\"\"}', 'image', 'royalhotel_menu_product_avatar_EEvmyUj4vJiiFzfI.jpeg', NULL, '[]', NULL, NULL, 1),
