(307, 1, 'incident', 'xhuwiuyh', 1, 10, 23, '2020-07-01', '19:12:13', 2, NULL, NULL, NULL, 'high', 0, '[\"3\",\"4\"]', NULL, 'Corrección de diversos errores', 'Home\r\n\r\n- Botón de registro debe tener un fondo para que se vea más\r\n\r\nhola/voxes\r\n\r\n- debería tener una forma de poder regresar al home\r\n\r\n- hay dos botones de solicita tu demo, dejaría solo la de arriba, con un texto como de solicita más información o algo del estilo o contactanos o algo y que el popup que sale sea diferente. Y la de abajo pondría algo como \"Demo GRATIS!\r\n\r\n- hay que cambiar los pantallas con la nueva experiencia.\r\n\r\n\r\n\r\nhola/menu  - hola/ encuesta  - hola/hoteles  -  hola/restaurantes \r\n\r\nel menu lateral todos los iconos te mandan al mismo popup\r\n\r\ncada uno debería ser\r\n\r\n1 - que te mande a donde esta el QR con la experiencia de menu\r\n\r\n2 - para que nos contacten \r\n\r\n3 - que te mande para hacer tu registro (que si quieres salir y regresar al al hola/menu tenga la opción)\r\n\r\n4 - icono de guestvox te mande al home\r\n\r\nLa imagen del QR debe de llevarte a la experiencia del menú. Este que esta es incorrecto.\r\n\r\nel enlace de linkedin no te lleva a ninguna pagina.\r\n\r\ny hay el de youtube es otro. Hay que revisar con Daniel.\r\n\r\n\r\n\r\nhola/hospitales\r\n\r\nigual que los otros pero también\r\n\r\nLa segunda imagen donde esta el texto de *y por qué una encuesta de satis.... esta imagen esta muy pequeña no esta en la misma dimensión que se propuso en el diseño.\r\n\r\nEl la parte de *notificaciones de eventos relacionados, el texto esta sobre la imagen no se entiende nada.\r\n\r\nPasa lo mismo en la ultima imágen en el texto de \"identifica tus áreas de oportunidad....\r\n\r\nY en este también hay que corregir el código QR.', NULL, NULL, NULL, NULL, NULL, '{\"lada\":\"\",\"number\":\"\"}', NULL, NULL, NULL, NULL, NULL, NULL, '[]', '[\"3\",\"2\"]', '[{\"user\":\"3\",\"date\":\"2020-07-31\",\"hour\":\"12:31:34\",\"cost\":\"\",\"comment\":\"Lo del bot\\u00f3n de registro en el home ya se hizo desde hace tiempo, de hecho as\\u00ed est\\u00e1 ahorita, te adjunto imagen. Lo del bot\\u00f3n de regresar al home desde las landings pages de las soluciones, Daniel nos hab\\u00eda comentado que no se pongan porque son landings de venta. Todo lo dem\\u00e1s de las landings hay que verlo con Sa\\u00fal, el es el responsable de esa parte. Lo agrego a este vox.\",\"attachments\":[]}]', '[{\"type\":\"created\",\"user\":\"2\",\"date\":\"2020-07-01\",\"hour\":\"19:13:23\"},{\"type\":\"commented\",\"user\":\"3\",\"date\":\"2020-07-31\",\"hour\":\"12:31:34\"},{\"type\":\"edited\",\"fields\":[{\"field\":\"opportunity_type\",\"before\":\"21\",\"after\":\"23\"}],\"user\":\"3\",\"date\":\"2020-07-31\",\"hour\":\"21:36:16\"},{\"type\":\"viewed\",\"user\":\"3\",\"date\":\"2020-08-03\",\"hour\":\"11:01:52\"},{\"type\":\"viewed\",\"user\":\"2\",\"date\":\"2020-08-03\",\"hour\":\"11:12:36\"},{\"type\":\"completed\",\"user\":\"2\",\"date\":\"2020-08-03\",\"hour\":\"11:12:36\"}]', 2, '2020-07-01', '19:13:23', 3, '2020-07-31', '21:36:16', 2, '2020-08-03', '11:12:36', NULL, NULL, NULL, NULL, 0, 'internal'),
