(732, 20, 'incident', 'nuwelu50', 269, 43, 280, '2020-10-15', '22:25:34', 64, NULL, NULL, NULL, 'medium', 0, '[]', NULL, 'Humo de Turibus en cuarto', 'Tissa se quejo arduamente por que el Turibus estaba estacionado afuera del Hostal y dijo que llevaba media hora prendido y que todo el humo estaba entrando a la habitación. Vino a Front gritando, me llevó a la habitación para que viera. No entre por ser femenina, entró gritando, despertó a Silvaneide (216). Me reclamo y me exijio hacer algo. Después Silvaneide me escribió un whats para saber que había pasado. Le expliqué, me dijo que estaba exagerando, que no olia nada.', 'Le dije a Tissa que me dejara ver que podía hacer, que esto era ageno al hostal pero que trataría de ayudar. Le comenté a Javier quien me dijo que le dijera que ya se iba el bus.Cuando baje fue el mensaje de Silvaneide. ', NULL, 'Tissa', 'Kimsey', NULL, '{\"lada\":\"\",\"number\":\"\"}', NULL, NULL, '924506285837  ', 37, '2020-10-13', '2020-10-16', '[]', '[\"93\",\"92\",\"90\"]', '[{\"user\":\"90\",\"date\":\"2020-10-16\",\"hour\":\"09:57:24\",\"cost\":\"\",\"comment\":\"out bien felices\",\"attachments\":[]}]', '[{\"type\":\"created\",\"user\":\"93\",\"date\":\"2020-10-15\",\"hour\":\"22:33:02\"},{\"type\":\"edited\",\"fields\":[{\"field\":\"firstname\",\"before\":null,\"after\":\"Tissa\"},{\"field\":\"lastname\",\"before\":null,\"after\":\"Kimsey\"},{\"field\":\"reservation_number\",\"before\":null,\"after\":\"924506285837  \"},{\"field\":\"reservation_status\",\"before\":null,\"after\":\"37\"},{\"field\":\"check_in\",\"before\":null,\"after\":\"2020-10-13\"},{\"field\":\"check_out\",\"before\":null,\"after\":\"2020-10-16\"}],\"user\":\"93\",\"date\":\"2020-10-15\",\"hour\":\"22:35:08\"},{\"type\":\"viewed\",\"user\":\"93\",\"date\":\"2020-10-15\",\"hour\":\"23:28:25\"},{\"type\":\"viewed\",\"user\":\"92\",\"date\":\"2020-10-16\",\"hour\":\"07:10:24\"},{\"type\":\"commented\",\"user\":\"90\",\"date\":\"2020-10-16\",\"hour\":\"09:57:24\"},{\"type\"