(968, 20, 'request', 'nedurg9i', 158, 43, 277, '2020-11-13', '23:19:15', 62, NULL, NULL, NULL, 'medium', 0, '[]', 'Huésped extendió por booking. No pude hacer el cobro a la tarjeta del sistema, me dijo el huésped que tenía un mensaje de que ya le habían cobrado. Se le explico que era el cargo de su reserva anterior. FAVOR DE COBRARLE. No lo vi hoy. LLAVE BLOQUEADA', NULL, NULL, NULL, NULL, 'Maxime', 'Goudet', NULL, '{\"lada\":\"\",\"number\":\"\"}', NULL, NULL, NULL, NULL, NULL, NULL, '[]', '[\"91\",\"93\",\"94\",\"80\"]', '[{\"user\":null,\"date\":\"2020-11-14\",\"hour\":\"19:42:41\",\"cost\":\"\",\"comment\":\"Hu\\u00e9sped mand\\u00f3 un e-mail a reservaciones con el cobr\\u00f3 del banco\",\"attachments\":[]},{\"user\":null,\"date\":\"2020-11-14\",\"hour\":\"19:48:24\",\"cost\":\"\",\"comment\":\"Hu\\u00e9sped mand\\u00f3 un e-mail a reservaciones con el cobr\\u00f3 del banco, estoy revisandolo y parece que el cobro que me esta mandando es el cobro de la reserva anterior. No esta en el hostal, si llega le explicar\\u00e9 sino por favor ma\\u00f1ana que le avisen\",\"attachments\":[]},{\"user\":null,\"date\":\"2020-11-14\",\"hour\":\"19:48:28\",\"cost\":\"\",\"comment\":\"Hu\\u00e9sped mand\\u00f3 un e-mail a reservaciones con el cobr\\u00f3 del banco, estoy revisandolo y parece que el cobro que me esta mandando es el cobro de la reserva anterior. No esta en el hostal, si llega le explicar\\u00e9 sino por favor ma\\u00f1ana que le avisen\",\"attachments\":[]},{\"user\":null,\"date\":\"2020-11-14\",\"hour\":\"19:48:34\",\"cost\":\"\",\"comment\":\"Hu\\u00e9sped mand\\u00f3 un e-mail a reservaciones con el cobr\\u00f3 del banco, estoy revisandolo y parece que el cobro que me esta mandando es el cobro de la reserva anterior. No esta en el hostal, si llega le explicar\\u00e9 sino por favor ma\\u00f1ana que le avisen\",\"attachments\":[]},{\"user\":null,\"date\":\"2020-11-14\",\"hour\":\"19:48:35\",\"cost\":\"\",\"comment\":\"Hu\\u00e9sped mand\\u00f3 un e-mail a reservaciones con el cobr\\u00f3 del banco, estoy revisandolo y parece que el cobro que me esta mandando es el cobro de la reserva anterior. No esta en el hostal, si llega le explicar\\u00e9 sino por favor ma\\u00f1ana que le avisen\",\"attachments\":[]},{\"user\":\"93\",\"date\":\"2020-11-14\",\"hour\":\"23:19:07\",\"cost\":\"\",\"comment\":\"Ya me dijo que pasa ma\\u00f1ana a cobrar. Estaba en check ins y no pude atenderlos\",\"attachments\":[]},{\"user\":\"94\",\"date\":\"2020-11-16\",\"hour\":\"01:50:59\",\"cost\":\"\",\"comment\":\"El hu\\u00e9sped lleg\\u00f3 en la madrugada en estado de ebriedad. Le coment\\u00e9 la situaci\\u00f3n de que ten\\u00eda que pagar pero el segu\\u00eda reclamando que ya hab\\u00eda pagado y que no quer\\u00eda pagar dos veces. Al final me dej\\u00f3 los datos de su tarjeta de cr\\u00e9dito y me dijo que si deb\\u00eda algo no ten\\u00eda problema en pagar. Se intentar\\u00e1 hacer el cobro en la terminal con la informaci\\u00f3n de la tarjeta ya que como comentaba Rodrigo, el pago que el hu\\u00e9sped mand\\u00f3 por correo es por la reservaci\\u00f3n anterior.\",\"attachments\":[]}]', '[{\"type\":\"created\",\"user\":\"93\",\"date\":\"2020-11-13\",\"hour\":\"23:20:47\"},{\"type\":\"commented\",\"user\":null,\"date\":\"2020-11-14\",\"hour\":\"19:42:41\"},{\"type\":\"commented\",\"user\":null,\"date\":\"2020-11-14\",\"hour\":\"19:48:24\"},{\"type\":\"commented\",\"user\":null,\"date\":\"2020-11-14\",\"hour\":\"19:48:28\"},{\"type\":\"commented\",\"user\":null,\"date\":\"2020-11-14\",\"hour\":\"19:48:34\"},{\"type\":\"commented\",\"user\":null,\"date\":\"2020-11-14\",\"hour\":\"19:48:35\"},{\"type\":\"commented\",\"user\":\"93\",\"date\":\"2020-11-14\",\"hour\":\"23:19:07\"},{\"type\":\"viewed\",\"user\":\"91\",\"date\":\"2020-11-15\",\"hour\":\"07:26:14\"},{\"type\":\"edited\",\"fields\":[{\"field\":\"observations\",\"before\":\"Hu\\u00e9sped extendi\\u00f3 por booking. No pude hacer el cobro a la tarjeta del sistema, me dijo el hu\\u0