(974, 20, 'request', 'cp06qbsq', 163, 43, 272, '2020-11-14', '18:48:59', 68, NULL, NULL, NULL, 'medium', 0, '[]', 'CANCELACIÓN DE VOUCHER vinieron a walk in tres personas, querian habitación privada, no había, les expliqué que solo habitación compartida, y me dijeron \"sí, pero yo en una y ellos dos (pareja)  en otra\". Hicimos la reserva, la pagaron con tarjeta, y cuando les estaba explicando sus habitaciones me dicen \"¿pero cómo? ¿porque es la 400 y me dices que cama 401 y 403\" y dije \"por que es compartida\". Como que no me entendían, por fin entendieron que alguien más podría entrar a la habitación. Pensaban que eran habitaciones con varias camas pero privadas. Procedí a hacer la cancelación del voucher', NULL, NULL, NULL, NULL, 'Miriam', 'Netzahual', NULL, '{\"lada\":\"\",\"number\":\"\"}', NULL, NULL, NULL, NULL, NULL, NULL, '[]', '[\"93\",\"91\"]', '[]', '[{\"type\":\"created\",\"user\":\"93\",\"date\":\"2020-11-14\",\"hour\":\"18:57:57\"},{\"type\":\"viewed\",\"user\":\"93\",\"date\":\"2020-11-14\",\"hour\":\"23:13:41\"},{\"type\":\"viewed\",\"user\":\"91\",\"date\":\"2020-11-15\",\"hour\":\"06:41:40\"},{\"type\":\"completed\",\"user\":\"91\",\"date\":\"2020-11-15\",\"hour\":\"06:41:40\"}]', 93, '2020-11-14', '18:57:57', NULL, NULL, NULL, 91, '2020-11-15', '06:41:40', NULL, NULL, NULL, NULL, 0, 'internal'),
(975, 20, 'request', 'n16lkzzd', 120, 43, 279, '2020-11-14', '21:27:20', 64, NULL, NULL, NULL, 'medium', 0, '[]', 'Llegó Yanik Ulrich para la 241, pero estaba ocupada por alguien. Lo tuve que poner en la 401. El huésped que se cambio de cama fue el de la 243 , su cama estaba vacia y sucia y en la 241 encontré un libro en frances y el es el unico fgrances en la habitación, además reconocí su bolsa donde mandó lavcandería. No lo he visto. FAVOR DE COBRARLE PENALIZACIÓN', NULL, NULL, NULL, NULL, 'David Felix', 'Bertrand', NULL, '{\"lada\":\"\",\"number\":\"\"}', NULL, NULL, NULL, NULL, NULL, NULL, '[]', '[\"91\",\"95\",\"93\"]', '[{\"user\":\"93\",\"date\":\"2020-11-14\",\"hour\":\"22:55:50\",\"cost\":\"\",\"comment\":\"Me coment\\u00f3 que le dijo a un recepcionista, no me supo decir quien pero que fue en la noche\",\"attachments\":[]},{\"user\":\"93\",\"date\":\"2020-11-14\",\"hour\":\"23:13:16\",\"cost\":\"\",\"comment\":\"Ya lo vi y dijo que si hab\\u00eda avisado, en la noche. Le pregunt\\u00e9 a Memo y dice que no\",\"attachments\":[]},{\"user\":\"95\",\"date\":\"2020-11-15\",\"hour\":\"14:09:59\",\"cost\":\"\",\"comment\":\"No est\\u00e1 cobrada la penalizaci\\u00f3n, el hu\\u00e9sped sigue ocupando las dos camas. No se hizo la divisi\\u00f3n en sistema\",\"attachments\":[]}]', '[{\"type\":\"created\",\"user\":\"93\",\"date\":\"2020-11-14\",\"hour\":\"21:30:41\"},{\"type\":\"edited\",\"fields\":[{\"field\":\"observations\",\"before\":\"Lleg\\u00f3 Yanik Ulrich para la 241, pero estaba ocupada por alguien. Lo tuve que poner en la 401. Estoy casi seguro que el que se cambiop de cama fue David Felix Bertrand ya que la 243 estaba vacia y sucia y en la 241 encontr\\u00e9 un libro en frances y el es el unico fgrances en la habitaci\\u00f3n. No lo he visto. FAVOR DE COBRARLE PENALIZACI\\u00d3N\",\"after\":\"Lleg\\u00f3 Yanik Ulrich para la 241, pero estaba ocupada por alguien. Lo tuve que poner en la 401. El hu\\u00e9sped que se cambio de cama fue el de la 243 , su cama estaba vacia y sucia y en la 241 encontr\\u00e9 un libro en frances y el es el unico fgrances en la habitaci\\u00f3n, adem\\u00e1s reconoc\\u00ed su bolsa donde mand\\u00f3 lavcander\\u00eda. No lo he visto. FAVOR DE COBRARLE PENALIZACI\\u00d3N\"}],\"user\":\"93\",\"date\":\"2020-11-14\",\"hour\":\"21:47:21\"},{\"type\":\"commented\",\"user\":\"93\",\"date\":\"2020-11-14\",\"hour\":\"22:55:50\"},{\"type\":\"commented\",\"user\":\"93\",\"date\":\"2020-11-14\",\"hour\":\"23:13:16\"},{\"type\":\"viewed\",\"user\":\"91\",\"date\":\"2020-11-15\",\"hour\":\"07:27:31\"},{\"type\":\"commented\",\"user\":\"95\",\"date\":\"2020-11-15\",\"hour\":\"14:09:59\"},{\"type\":\"viewed\",\"user\":\"95\",\"date\":\"2020-11-15\",\"hour\":\"14:10:00\"},{\"type\":\"viewed\",\"user\":\"93\",\"date\":\"2020-11-15\",\"hour\":\"18:14:23\"},{\"type\":\"completed\",\"user\":\"93\",\"date\":\"2020-11-15\",\"hour\":\"18:14:23\"}]', 93, '2020-11-14', '21:30:41', 93, '2020-11-14', '21:47:21', 93, '2020-11-15', '18:14:23', NULL, NULL, NULL, NULL, 0, 'internal'),
